import React from "react";
import {trackerType} from "../Tracker/Tracker";
import styled from "styled-components";

type displayProps = {
    tracker: trackerType;
}

const Wrapper = styled.section`
    bottom: 0;
    margin: 0;
    left: 0;
    padding: 0;
    position: absolute;
    width: calc(100vw - 50px);
`;

const Display: React.FC<displayProps> = (props) => {
    const {tracker} = props;
    return<Wrapper><h2>{tracker.x} | {tracker.y}</h2></Wrapper>
};

export default Display;
